INSERT INTO `corporation` VALUES ('005380','현대차','https://minination.s3.ap-southeast-2.amazonaws.com/hyundai-logo.png','https://blog.kakaocdn.net/dn/bCmfq4/btqxG7OOGdC/Eepm4tqFfQOy6KkY9maiqk/img.gif','현대자동차는 자동차, 그리고 자동차 부품을 제조하고 판매하는 완성차 제조업체에요. 국내 최초로 독자 모델 포니를 개발하며 대한민국 자동차 산업의 선구자 역할을 해 왔어요. 세계 200개국에 자동차를 수출하고 글로벌 생산기지를 건설하는 한편, 선도적 자율주행 기술을 바탕으로 미래 모빌리티 산업을 견인하고 있어요.','https://comp.fnguide.com/SVO2/ASP/SVD_Finance.asp?pGB=1&gicode=A005380&cID=&MenuYn=Y&ReportGB=&NewMenuID=103&stkGb=701','https://www.hyundai.com/kr/ko/e/vehicles/estimation','https://www.hyundai.co.kr/main/mainRecommend','2023-09-25 13:42:21.443732',NULL,'2023-09-25 13:42:21.443732',NULL),('005930','삼성전자','https://minination.s3.ap-southeast-2.amazonaws.com/samsung-cover.png','https://biz.chosun.com/resizer/5DEr4LtJ1dSz7ZQ35ogDanBaJoE=/616x0/smart/cloudfront-ap-northeast-1.images.arcpublishing.com/chosunbiz/XLYL7D7AJVHDXK57Z6RROVD4X4.gif','삼성전자는 전자제품을 만들고 전세계에 판매하는 큰 회사에요.판매하는 다양한 물건 중에는 TV, 컴퓨터, 모니터, 냉장고, 세탁기, 에어컨, 스마트폰, 네트워크 장치, 그리고 컴퓨터와 같은 것들이 있어요. 또한 작은 컴퓨터 칩과 같은 것들도 만들어요.','https://comp.fnguide.com/SVO2/ASP/SVD_Finance.asp?pGB=1&gicode=','https://www.samsung.com/sec/','https://www.samsung.com/sec/aboutsamsung/home/','2023-09-25 13:35:42.247906',NULL,'2023-09-25 13:35:42.247906',NULL),('035720','카카오','https://minination.s3.ap-southeast-2.amazonaws.com/kakao-logo.png','https://mir-s3-cdn-cf.behance.net/project_modules/1400/f80ea461852513.5c5306ea3f4e0.gif','카카오는 국내 1위 메신저인 카카오톡을 포함한 다양한 모바일 서비스를 제공 중인 \'모바일 라이프 플랫폼\' 기업이에요. 인터넷 포털 사이트 다음(Daum)을 비롯해 모바일/인터넷 기반의 커머스, 모빌리티, 금융, 게임, 음악, 스토리 IP를 주축으로 사업을 전개하고 있어요.','https://comp.fnguide.com/SVO2/ASP/SVD_Finance.asp?pGB=1&gicode=A035720&cID=&MenuYn=Y&ReportGB=&NewMenuID=103&stkGb=701','https://www.kakaocorp.com/page/service/service','https://www.kakaocorp.com/page/','2023-10-01 22:44:48.592215',NULL,'2023-10-01 22:44:48.592215',NULL),('225570','넥슨게임즈','https://minination.s3.ap-southeast-2.amazonaws.com/nexon-logo.png','https://www.nexongames.co.kr/video/Hit2.mp4','넥슨은 우수한  IP와 탄탄한 개발력, 20년 이상의 온라인게임 서비스 경험을 바탕으로 글로벌 종합 엔터테인먼트 기업으로 거듭나고 있어요. \'메이플스토리\', \'던전앤파이터\', \'카트라이더\', \'마비노기\' 등 핵심 IP와 함께, 새로운 상상력과 아이디어를 담아낸 게임 콘텐츠를 50종 이상, 190여개 국가, 19억 명의 글로벌 이용자에게 서비스하고 있어요.','https://comp.fnguideB=&NewMenuID=103&stkGb=701','https://www.nexon.com/Home/Game','https://www.nexongames.co.kr/','2023-09-25 13:47:34.494058',NULL,'2023-09-27 13:45:11.755266',NULL),('352820','하이브','https://minination.s3.ap-southeast-2.amazonaws.com/%EB%84%A5%EC%8A%A8.txt','https://cloudfront-ap-northeast-1.images.arcpublishing.com/chosunbiz/VUSCZGH3E5ARJEDG5ZKSFXQZ5E.gif','하이브(HYBE)는 프로듀서 방시혁이 설립한 엔터테인먼트 기업으로 방탄소년단이 소속되어 있는 기획사에요. 방탄소년단, 르세라핌, 세븐틴, 프로미스나인, 지코 등 대한민국의 유명한 아티스트들이 소속되어 있어요.','https://comp.fnguide.com/SVO2/ASP/SVD_Finance.asp?pGB=1&gicode=A352820&cID=&MenuYn=Y&ReportGB=&NewMenuID=103&stkGb=701','https://hybecorp.com/kor/company/artist','https://hybecorp.com/kor/main','2023-09-27 14:04:13.042844',NULL,'2023-09-27 14:09:46.466801',NULL);
